import React from "react";
import Home from "./Home";
import Training from "./Training";
import Placement from "./Placement";
import { Router,Link,Routes,Route } from "react-router-dom";

function Navigate(){
    return <Router>
        <div>
            <ul>
              <li class="nav-link">
                <Link to="/">Home</Link>
              </li>
            </ul>
            
          </div>
    </Router>
}
export default Navigate;
